import  "./ExpenseItem.css";

function ExpenseItem() {
return <div>
    <div className='expense-item'>March 28th 2021</div>
    <div className='expense-item__description'>
        <h2>Car insurance</h2>
        <div className='expense-item__price'>$294.53</div>
    </div>
</div>
}

export default ExpenseItem;
